import React from "react";

const Outputs = () => {
  const grade = 90;
  const totalWeight = 100;
  return (
    <section className="outputs">
      <h3>Your Grades</h3>
      <p>
        Grade: <span style={{ fontWeight: "bold" }}>{grade}%</span>
      </p>
      <p>
        Total Weight:{" "}
        <span style={{ fontWeight: "bold" }}>{totalWeight} %</span>
      </p>
    </section>
  );
};

export default Outputs;
